import React from 'react';
import './App.css';
import Shop from './Shop';
import About from './About';
import Navbar from './Navbar';

function App() {
  return (
    <div className="App">
      <Navbar></Navbar>
      <Shop></Shop>
      <About></About>
    </div>
  );
}

export default App;
